import { FormControl, InputLabel, Input } from "@mui/material";

const LoginForm = () => {
  return (
  <FormControl>
    <InputLabel htmlFor="username">Username</InputLabel>
    <Input id="username" aria-describedby="username" required placeholder="Username"/>
  </FormControl>
  );
};

export default LoginForm;
